import React from 'react';
import { SentimentData } from '../types';

interface SentimentPanelProps {
  sentimentData?: SentimentData;
  isLoading: boolean;
}

export const SentimentPanel: React.FC<SentimentPanelProps> = ({ sentimentData, isLoading }) => {
  if (isLoading) {
    return (
      <div className="bg-white rounded-lg shadow-md p-6">
        <h2 className="text-xl font-semibold mb-4">Social Sentiment</h2>
        <div className="animate-pulse">
          <div className="h-4 bg-gray-200 rounded mb-2"></div>
          <div className="h-4 bg-gray-200 rounded mb-2"></div>
          <div className="h-4 bg-gray-200 rounded"></div>
        </div>
      </div>
    );
  }

  if (!sentimentData) {
    return (
      <div className="bg-white rounded-lg shadow-md p-6">
        <h2 className="text-xl font-semibold mb-4">Social Sentiment</h2>
        <p className="text-gray-500">No sentiment data available</p>
      </div>
    );
  }

  const { sentiment, confidence, totalPosts, positivePosts, negativePosts, neutralPosts } = sentimentData;

  // Determine sentiment color and label
  const getSentimentColor = (sentiment: number) => {
    if (sentiment > 0.1) return 'text-green-600';
    if (sentiment < -0.1) return 'text-red-600';
    return 'text-gray-600';
  };

  const getSentimentLabel = (sentiment: number) => {
    if (sentiment > 0.1) return 'Positive';
    if (sentiment < -0.1) return 'Negative';
    return 'Neutral';
  };

  const getSentimentIcon = (sentiment: number) => {
    if (sentiment > 0.1) return '😊';
    if (sentiment < -0.1) return '😞';
    return '😐';
  };

  return (
    <div className="bg-white rounded-lg shadow-md p-6">
      <h2 className="text-xl font-semibold mb-4">Social Sentiment</h2>

      <div className="space-y-4">
        {/* Main sentiment display */}
        <div className="text-center">
          <div className="text-4xl mb-2">{getSentimentIcon(sentiment)}</div>
          <div className={`text-2xl font-bold ${getSentimentColor(sentiment)}`}>
            {getSentimentLabel(sentiment)}
          </div>
          <div className="text-sm text-gray-500">
            Score: {sentiment.toFixed(2)} (-1 to 1)
          </div>
        </div>

        {/* Confidence bar */}
        <div>
          <div className="flex justify-between text-sm text-gray-600 mb-1">
            <span>Confidence</span>
            <span>{(confidence * 100).toFixed(0)}%</span>
          </div>
          <div className="w-full bg-gray-200 rounded-full h-2">
            <div 
              className="bg-blue-600 h-2 rounded-full transition-all duration-300"
              style={{ width: `${confidence * 100}%` }}
            ></div>
          </div>
        </div>

        {/* Sentiment breakdown */}
        <div className="grid grid-cols-3 gap-4 text-center">
          <div className="bg-green-50 rounded-lg p-3">
            <div className="text-green-600 font-semibold">{positivePosts}</div>
            <div className="text-xs text-gray-500">Positive</div>
          </div>
          <div className="bg-gray-50 rounded-lg p-3">
            <div className="text-gray-600 font-semibold">{neutralPosts}</div>
            <div className="text-xs text-gray-500">Neutral</div>
          </div>
          <div className="bg-red-50 rounded-lg p-3">
            <div className="text-red-600 font-semibold">{negativePosts}</div>
            <div className="text-xs text-gray-500">Negative</div>
          </div>
        </div>

        {/* Total posts */}
        <div className="text-center text-sm text-gray-500">
          Based on {totalPosts} social media posts
        </div>
      </div>
    </div>
  );
};
